// ==UserScript==
// @name         Corollafication: A Visual Upgrade
// @namespace    https://github.com/dullmace/corollafication
// @version      1.1
// @description  Transform your mundane 5x5 Friday grids into masterpieces with Corollafication, the only script bold enough to fix your musical missteps. This revolutionary tool scans for your questionable taste on Twitter/X.com and overlays the only album that matters: *any* release by 95COROLLA.
// @author
// @match        https://twitter.com/*
// @match        https://x.com/*
// @grant        none
// @run-at       document-idle
// @license      MIT
// @homepageURL  https://github.com/dullmace/corollafication
// @supportURL   https://github.com/dullmace/corollafication/issues
// ==/UserScript==

(function() {
    'use strict';

    const DEBUG = true;
    const log = (...args) => DEBUG && console.log('[Corollafication]', ...args);

    const CONFIG = {
        overlays: [
            // Use data URIs to comply with CSP
            {
                url: 'data:image/jpeg;base64,', // Base64-encoded image
                opacity: 0.9
            },
            {
                url: 'data:image/jpeg;base64,', // Base64-encoded image
                opacity: 0.9
            }
        ],
        keywords: ['5x5', 'music friday', 'friday x5', 'friday x 5', 'friday 5x5']
    };

    /**
     * Checks if the tweet text matches the criteria
     */
    function matchesPostCriteria(tweetText) {
        const text = tweetText.toLowerCase();
        return CONFIG.keywords.some(keyword => text.includes(keyword));
    }

    /**
     * Adds overlay to the media element
     */
    function addOverlay(mediaElement) {
        if (mediaElement.getAttribute('data-overlay-added')) {
            return;
        }
        mediaElement.setAttribute('data-overlay-added', 'true');

        // Ensure the parent is positioned relatively
        const parent = mediaElement.parentElement;
        if (parent) {
            parent.style.position = 'relative';

            CONFIG.overlays.forEach((overlayConfig, index) => {
                const overlayImg = document.createElement('img');
                overlayImg.src = overlayConfig.url;
                overlayImg.style.cssText = `
                    position: absolute;
                    top: 0;
                    left: 0;
                    width: 100%;
                    height: 100%;
                    opacity: ${overlayConfig.opacity};
                    pointer-events: none;
                    object-fit: cover;
                    z-index: ${1000 + index};
                `;
                parent.appendChild(overlayImg);
            });
        }
    }

    /**
     * Processes tweets on the page
     */
    function processTweets() {
        const tweets = document.querySelectorAll('article');

        tweets.forEach(tweet => {
            if (tweet.getAttribute('data-processed')) {
                return;
            }
            tweet.setAttribute('data-processed', 'true');

            const tweetTextElement = tweet.querySelector('[data-testid="tweetText"]');
            const tweetText = tweetTextElement ? tweetTextElement.innerText : '';

            if (matchesPostCriteria(tweetText)) {
                const mediaElements = tweet.querySelectorAll('[data-testid="tweetPhoto"] img, [data-testid="tweetVideo"] video');
                mediaElements.forEach(addOverlay);
            }
        });
    }

    /**
     * Initializes the script
     */
    function init() {
        log('Initializing Corollafication');

        processTweets();

        const observer = new MutationObserver(() => {
            processTweets();
        });

        observer.observe(document.body, {
            childList: true,
            subtree: true
        });

        log('Mutation observer set up');
    }

    // Start after a short delay to ensure page load
    setTimeout(init, 1000);
})();
